{"title":"Fast and Easy Pasta With Blistered Cherry Tomato Sauce","description":"Cherry tomatoes are almost always sweeter, riper, and higher in pectin than larger tomatoes at the supermarket. All of these factors mean that cherry tomatoes are fantastic for making a rich, thick, flavorful sauce. Even better: It takes only four ingredients and about 10 minutes, start to finish — less time than it takes to cook the pasta you're gonna serve it with.","preparation_time_minutes":12,"servings":{"min":4,"max":6},"steps":["Place pasta in a large skillet or sauté pan and cover with water and a big pinch of salt. Bring to a boil over high heat, stirring occasionally. Boil until just shy of al dente, about 1 minute less than the package instructions recommend.","Meanwhile, heat garlic and 4 tablespoons (60ml) olive oil in a 12-inch skillet over medium heat, stirring frequently, until garlic is softened but not browned, about 3 minutes. Add tomatoes and cook, stirring, until tomatoes begin to burst. You can help them along by pressing on them with the back of a wooden spoon as they soften.","Continue to cook until sauce is rich and creamy, about 5 minutes longer. Stir in basil and season to taste with salt and pepper.","When pasta is cooked, drain, reserving 1 cup of pasta water. Add pasta to sauce and increase heat to medium-high. Cook, stirring and tossing constantly and adding reserved pasta water as necessary to adjust consistency to a nice, creamy flow. Remove from heat, stir in remaining 2 tablespoons (30ml) olive oil, and grate in a generous shower of Parmesan cheese. Serve immediately, passing extra Parmesan at the table."],"ingredients":[{"name":"Dry pasta","amount":450,"unit":"grams"},{"name":"Kosher salt"},{"name":"Cloves garlic","amount":4,"unit":"pcs"},{"name":"Extra-virgin olive oil","amount":90,"unit":"ml"},{"name":"Cherry tomatoes","amount":750,"unit":"grams"},{"name":"Fresh basil leaves","amount":30,"unit":"grams"},{"name":"Freshly ground black pepper"},{"name":"Parmesan cheese"}],"created":"2017-03-29T14:43:21Z","ratings":[4.5,5.0,3.0,4.5]}
{"index":{"_id":2}}
{"title":"Pasta With Butternut Squash and Sage Brown Butter","description":"Brown butter-based pasta sauces are some of the simplest things around. They're emulsions made with a flavorful fat and pasta cooking water that coats the pasta in a thin, creamy sheen of flavor. Throw in some sautéd squash and some sage and you've got yourself a great 30-minute meal. It's a classic fall and winter dish that can be made right on the stovetop.","preparation_time_minutes":30,"servings":{"min":4,"max":6},"steps":["Heat olive oil in a large stainless steel or cast-iron skillet over high heat until very lightly smoking. Immediately add squash, season with salt and pepper, and cook, stirring and tossing occasionally, until well-browned and squash is tender, about 5 minutes. Add butter and shallots and continue cooking, stirring frequently, until butter is lightly browned and smells nutty, about 1 minute longer. Add sage and stir to combine (sage should crackle and let off a great aroma). Remove from heat and stir in lemon juice. Set aside.","In a medium saucepan, combine pasta with enough room temperature or hot water to cover by about 2 inches. Season with salt. Set over high heat and bring to a boil while stirring frequently. Cook, stirring frequently, until pasta is just shy of al dente, about 2 minutes less than the package directions. Drain pasta, reserving a couple cups of the starchy cooking liquid.","Add pasta to skillet with squash along with a splash of pasta water. Bring to a simmer over high heat and cook until the pasta is perfectly al dente, stirring and tossing constantly and adding a splash of water as needed to keep the sauce loose and shiny. Off heat, stir in Parmigiano-Reggiano. Adjust seasoning with salt and pepper and texture with more pasta water as needed. Serve immediately, topped with more cheese at the table."],"ingredients":[{"name":"extra-virgin olive oil","amount":30,"unit":"ml"},{"name":"Butternut squash","amount":450,"unit":"grams"},{"name":"Kosher salt"},{"name":"Freshly ground black pepper"},{"name":"Unsalted butter","amount":30,"unit":"grams"},{"name":"Shallot","amount":1,"unit":"pcs"},{"name":"Fresh sage leaves","amount":15,"unit":"grams"},{"name":"Lemon juice","amount":15,"unit":"ml"},{"name":"Penne","amount":450,"unit":"grams"},{"name":"Grated fresh Parmigiano-Reggiano cheese","amount":30,"unit":"grams"}],"created":"2014-12-19T10:21:01Z","ratings":[3.0,4.0,3.5,2.0]}
