{"title":"Ricotta Gnocchi With Asparagus and Prosciutto","description":"Fresh ricotta gnocchi may be the fastest fresh-pasta recipe I know. With a little practice, I've gotten it down to under ten minutes (8 minutes 53 seconds, to be precise). But the great part about this recipe is that it serves as a suitable base for a huge variety of sauces and flavors. For instance, last week a friend of mine brought over some delicious first-of-the-season fresh asparagus which we combined with prosciutto and an easy cream sauce to make a delicious impromptu (and fast!) meal on the spot.","preparation_time_minutes":20,"servings":{"min":3,"max":4},"steps":["Set a large pot of salted water over high heat. Meanwhile, heat olive oil in a large skillet or slope-sided saucepan over medium-high heat until shimmering. Add prosciutto and cook, stirring, until mostly crisp, about 2 minutes. Add scallions and garlic and cook, stirring, until fragrant, about 1 minute. Add asparagus and cook, tossing and stirring frequently, until asparagus is just starting to turn tender, about 2 minutes.","Add heavy cream and half of Parmesan. Cook, stirring, until cream thickens and coats the asparagus pieces, about 4 minutes. Season to taste with salt and pepper.","Add gnocchi to now-boiling pot of water, stir gently, and cook until gnocchi float for 30 seconds, about 3 minutes total. Drain gnocchi, reserving 1/4 cup of pasta cooking water. Add gnocchi, lemon juice, half of lemon zest, chives, and 2 tablespoons of cooking water to saucepan with sauce and bring to a hard boil, stirring gently. Add more pasta water to thin sauce to desired consistency. Serve immediately, topped with lemon zest and additional Parmesan cheese."],"ingredients":[{"name":"Extra-virgin olive oil","amount":1,"unit":"tbsp"},{"name":"Thinly sliced prosciutto","amount":115,"unit":"grams"},{"name":"Thinly sliced green garlic","amount":0.25,"unit":"cups"},{"name":"Cloves garlic","amount":2,"unit":"pcs"},{"name":"Asparagus","amount":450,"unit":"grams"},{"name":"Heavy cream","amount":1,"unit":"cups"},{"name":"Grated Parmigiano-Reggiano cheese","amount":55,"unit":"grams"},{"name":"Kosher salt"},{"name":"Freshly ground black pepper"},{"name":"Lemon juice","amount":1,"unit":"tbsp"},{"name":"grated zest","amount":1,"unit":"tsp"},{"name":"Minced fresh chives","amount":2,"unit":"tbsp"},{"name":"Ricotta"}],"created":"2007-01-23T07:51:22Z","ratings":[5.0]}
