{"title":"Shrimp Fra Diavolo (Spaghetti With Spicy Tomato Sauce)","description":"Lobster fra diavolo is a classic Italian-American pasta dish, but the lobster version is a lot easier for restaurants than home cooks. Shrimp make an excellent stand-in, as long as you know how to infuse the spicy tomato sauce with some real shellfish flavor.","preparation_time_minutes":30,"servings":{"min":4,"max":4},"steps":["Bring a large pot of salted water to a boil. In a medium bowl, toss the shrimp well with the 1/2 teaspoon salt and the baking soda. Set aside.","In a large skillet or sauté pan, heat 4 tablespoons olive oil over medium-high heat until shimmering, Add reserved shrimp shells and cook, stirring constantly, until they've all turned a reddish color, about 4 minutes. Off the heat, remove the shells using tongs, a slotted spatula, and/or a slotted spoon, allowing any excess oil to drain back into skillet as you go; discard the shells. You should still have plenty of oil left in the skillet.","Return the skillet to medium-high heat, add the shrimp, and cook, stirring and turning occasionally, until shrimp are just starting to brown in spots and are almost fully cooked through, about 3 minutes. Off the heat, transfer shrimp to a plate and set aside.","Return the skillet to medium-low heat. Add garlic, oregano, and chili flakes and cook, stirring, until garlic is just beginning to turn golden, about 3 minutes. Add brandy, if using, and cook until almost fully evaporated. Add tomatoes and clam juice and bring to a simmer. Season with salt.","Boil the pasta in the pot of salted water until al dente. Drain, reserving about 1 cup of the pasta cooking water, and add pasta to the sauce along with a splash of the pasta cooking water. Add shrimp and cook over medium-high heat, stirring, until the sauce reduces and clings to pasta and the shrimp are fully heated through; add more pasta water as necessary if the sauce becomes too dry. Season with salt, if necessary.","Stir in parsley and remaining 2 tablespoons olive oil. Serve right away."],"ingredients":[{"name":"Kosher salt","amount":0.5,"unit":"tsp"},{"name":"Large shrimp","amount":340,"unit":"grams"},{"name":"Large pinch baking soda"},{"name":"Extra-virgin olive oil","amount":90,"unit":"ml"},{"name":"Cloves garlic","amount":4,"unit":"pcs"},{"name":"Dried oregano","amount":1.5,"unit":"tsp"},{"name":"Red chili flakes ","amount":1.5,"unit":"tsp"},{"name":"Brandy","amount":30,"unit":"ml"},{"name":"Whole peeled tomatoes","amount":800,"unit":"grams"},{"name":"Clam juice","amount":120,"unit":"ml"},{"name":"Spaghetti","amount":450,"unit":"grams"},{"name":"Minced flat-leaf parsley leaves","amount":0.25,"unit":"cups"}],"created":"2001-07-01T09:43:51Z","ratings":[1.5,3.0,3.5,2.0]}
