{"title":"Stovetop Macaroni and Cheese","description":"This macaroni and cheese — this pot of creamy, gooey, cheesy, glorious macaroni and cheese — was made with three ingredients in about 10 minutes. Seriously. That's one fewer ingredient than you need to add to the pot to make a box of Kraft macaroni and cheese. Not only that, but all three ingredients are staples, with shelf lives of weeks or months, which means that a simple lunch is always on hand.","preparation_time_minutes":8,"servings":{"min":2,"max":2},"steps":["Place macaroni in a medium saucepan or skillet and add just enough cold water to cover. Add a pinch of salt and bring to a boil over high heat, stirring frequently. Continue to cook, stirring, until water has been almost completely absorbed and macaroni is just shy of al dente, about 6 minutes.","Immediately add evaporated milk and bring to a boil. Add cheese. Reduce heat to low and cook, stirring continuously, until cheese is melted and liquid has reduced to a creamy sauce, about 2 minutes longer. Season to taste with more salt and serve immediately."],"ingredients":[{"name":"Elbow macaroni","amount":170,"unit":"grams"},{"name":"Evaporated milk","amount":180,"unit":"ml"},{"name":"Cheddar cheese","amount":170,"unit":"grams"}],"created":"2013-04-17T21:01:55Z","ratings":[5.0,5.0,4.5,5.0,4.0,5.0]}
