{"title":"Spaghetti Aglio e Olio Recipe","description":"One of the most basic pasta sauces, aglio e olio uses just garlic and olive oil (and maybe a pinch of red pepper flakes for heat). It sounds too simple to be good, but it's among the best.","preparation_time_minutes":10,"servings":{"min":4,"max":4},"steps":["In a pot of salted boiling water, cook spaghetti until just shy of al dente (about 1 minute less than the package directs). Reserve pasta cooking water.","Meanwhile, in a large skillet, combine 6 tablespoons oil and garlic. Add pinch of red pepper flakes, if using. Cook over medium heat until garlic is very lightly golden, about 5 minutes. (Adjust heat as necessary to keep it gently sizzling.)","Transfer pasta to skillet along with 1/2 cup pasta water, increase heat to high, and cook, stirring and tossing rapidly, until a creamy, emulsified sauce forms and coats the noodles. Remove from heat, add remaining 2 tablespoons olive oil, and stir well to combine. Mix in parsley, if using, and serve right away."],"ingredients":[{"name":"Kosher salt"},{"name":"Dried spaghetti","amount":450,"unit":"grams"},{"name":"Extra-virgin olive oil","amount":120,"unit":"ml"},{"name":"Cloves garlic","amount":4,"unit":"pcs"},{"name":"Red pepper flakes"},{"name":"Minced flat-leaf parsley"}],"created":"2016-09-23T22:34:00Z","ratings":[0.5,3.5,2.5,3.0,1.0,4.0]}
