{"title":"Vegan Carbonara Pasta","description":"Carbonara may be one of the most difficult recipes to vegan-ify, since every major ingredient in the sauce is off-limits. But by eating lots of the real deal and getting mighty crafty with an array of unlikely ingredients, I managed to create a vegan carbonara that captures the essence of the original like no other: It's silky and rich, unctuous, and studded with meaty bits, with the sharp, lactic tang of Pecorino Romano (but, of course, no actual Pecorino Romano).","preparation_time_minutes":30,"servings":{"min":4,"max":4},"steps":["In a blender, combine tofu, sauerkraut brine, nutritional yeast, miso, cayenne or chili flakes, smoked paprika, black pepper, and vinegar or lemon juice. Blend at high speed, stopping to scrape down sides if necessary, until a very smooth, silky sauce forms. Season with salt. Add 1/4 cup (60ml) olive oil and blend in at low speed just until emulsified.","In a large sauté pan, heat remaining 1/4 cup (60ml) olive oil over medium-high heat until shimmering. Add mushrooms and cook, stirring, until browned, about 6 minutes.","In a pot of salted boiling water, cook pasta until just al dente. Transfer pasta to pan with mushrooms, reserving pasta-cooking water. Pour on just enough creamy sauce to coat all the pasta, then add about 1/4 cup (60ml) pasta-cooking water. Cook over medium heat, stirring, until sauce forms a silky glaze that coats pasta. Serve."],"ingredients":[{"name":"Silken tofu","amount":200,"unit":"grams"},{"name":"Sauerkraut brine","amount":120,"unit":"ml"},{"name":"Nutritional yeast","amount":15,"unit":"grams"},{"name":"White miso","amount":15,"unit":"ml"},{"name":"Cayenne pepper"},{"name":"Smoked paprika","amount":0.25,"unit":"tsp"},{"name":"Freshly ground black pepper","amount":2,"unit":"tsp"},{"name":"White wine vinegar","amount":1,"unit":"tsp"},{"name":"Kosher salt"},{"name":"Extra-virgin olive oil","amount":120,"unit":"ml"},{"name":"King oyster mushrooms","amount":115,"unit":"grams"},{"name":"Dry spaghetti or penne","amount":450,"unit":"grams"}],"created":"2002-01-04T12:55:42Z","ratings":[3.0,2.5,4.0,4.5,3.5,4.0]}
