{"title":"Bucatini all'Amatriciana","description":"Debate rages over the correct way to make a classic Roman amatriciana sauce of cured pork and tomatoes. We tested all the variables to come up with this ideal version, which packs a delicate heat, gentle black-pepper spice, sharp Pecorino Romano cheese, and the intriguing interplay of sweet-tart tomato sauce and rich, fatty cured pork.","preparation_time_minutes":20,"servings":{"min":4,"max":4},"steps":["In a large skillet, heat olive oil over medium-high heat until shimmering. Add guanciale and pepper flakes and cook, stirring, until lightly browned, about 5 minutes. Add wine and cook, scraping up any browned bits on bottom of pan, until nearly evaporated, about 3 minutes.","Add tomatoes and bring to a simmer. Season with salt and pepper.","Meanwhile, boil pasta in salted water until just shy of al dente, about 1 minute less than package recommends. Using tongs, transfer pasta to sauce, along with 1/4 cup pasta cooking water. Cook over high heat, stirring and tossing rapidly, until pasta is al dente and sauce has thickened and begins to coat noodles. Remove from heat, add cheese, and stir rapidly to incorporate. Season to taste with more salt and pepper. Serve right away, passing more cheese at the table."],"ingredients":[{"name":"Extra-virgin olive oil","amount":1,"unit":"tsp"},{"name":"Guanciale","amount":170,"unit":"grams"},{"name":"Pinch red pepper flakes"},{"name":"Dry white wine","amount":60,"unit":"ml"},{"name":"Can whole peeled tomatoes","amount":425,"unit":"grams"},{"name":"Kosher salt"},{"name":"Freshly ground black pepper"},{"name":"Dried bucatini pasta","amount":450,"unit":"grams"},{"name":"Grated Pecorino Romano cheese","amount":30,"unit":"grams"}],"created":"2016-09-24T16:51:22Z","ratings":[5.0,5.0,4.5,5.0,4.0,5.0,3.5,4.5]}
