{"title":"Penne With Hot-As-You-Dare Arrabbiata Sauce","description":"Exceedingly simple in concept and execution, arrabbiata sauce is tomato sauce with the distinction of being spicy enough to earn its \"angry\" moniker. Here's how to make it, from start to finish.","preparation_time_minutes":15,"servings":{"min":4,"max":4},"steps":["In a medium saucepan of boiling salted water, cook penne until just short of al dente, about 1 minute less than the package recommends.","Meanwhile, in a large skillet, combine oil, garlic, and pepper flakes. Cook over medium heat until garlic is very lightly golden, about 5 minutes. (Adjust heat as necessary to keep it gently sizzling.)","Add tomatoes, stir to combine, and bring to a bare simmer. When pasta is ready, transfer it to sauce using a strainer or slotted spoon. (Alternatively, drain pasta through a colander, reserving 1 cup of cooking water. Add drained pasta to sauce.)","Add about 1/4 cup pasta water to sauce and increase heat to bring pasta and sauce to a vigorous simmer. Cook, stirring and shaking the pan and adding more pasta water as necessary to keep sauce loose, until pasta is perfectly al dente, 1 to 2 minutes longer. (The pasta will cook more slowly in the sauce than it did in the water.)","Continue cooking pasta until sauce thickens and begins to coat noodles, then remove from heat and toss in cheese and parsley, stirring vigorously to incorporate. Stir in a drizzle of fresh olive oil, if desired. Season with salt and serve right away, passing more cheese at the table."],"ingredients":[{"name":"Kosher salt"},{"name":"Penne pasta","amount":450,"unit":"grams"},{"name":"Extra-virgin olive oil","amount":3,"unit":"tbsp"},{"name":"Clove garlic","amount":1,"unit":"pcs"},{"name":"Crushed red pepper"},{"name":"Can whole peeled tomatoes","amount":400,"unit":"grams"},{"name":"Finely grated Parmesan cheese","amount":60,"unit":"grams"},{"name":"Minced flat-leaf parsley leaves","amount":1,"unit":"handful"}],"created":"2017-04-27T15:14:52Z","ratings":[1.5,2.0,4.0,3.5,3.0,5.0,1.5]}
