{"title":"Penne With Melted-Vegetable Sauce","description":"Made with vegetables that have been cooked until meltingly soft, this penne pasta dish is one of those great examples of what makes classic rustic Italian cooking so special: It makes the most of humble and unassuming ingredients, turning them into something downright delicious.","preparation_time_minutes":30,"servings":{"min":4,"max":4},"steps":["In a medium pot of salted boiling water, cook potato until a piece is easily crushed between fingers, about 5 minutes. Using fine strainer, transfer to large mixing bowl. Working one vegetable at a time, continue by boiling carrots, string beans, fennel, and onion until each is well done, about 5 minutes each; add each vegetable to mixing bowl as it is ready.","Add penne to boiling water and cook until al dente, following timing on package. Drain, reserving 1 cup of cooking water.","Meanwhile, add garlic, olive oil, and parsley to vegetables, and mix thoroughly until potatoes have broken down for form a chunky puree. Season with salt and pepper.","Add penne and a healthy grating of Parmigiano-Reggiano to vegetable sauce and stir to combine, adding cooking water 1 tablespoon at a time if sauce is too thick. Spoon into bowls, top with additional grated cheese, and serve."],"ingredients":[{"name":"Kosher salt"},{"name":"Large russet potato","amount":1,"unit":"pcs"},{"name":"Medium carrots","amount":2,"unit":"pcs"},{"name":"String beans","amount":85,"unit":"grams"},{"name":"Small fennel bulb","amount":0.5,"unit":"pcs"},{"name":"Small red onion","amount":1,"unit":"pcs"},{"name":"Dried penne","amount":450,"unit":"grams"},{"name":"Cloves garlic","amount":3,"unit":"pcs"},{"name":"Extra-virgin olive oil","amount":0.75,"unit":"cups"},{"name":"Minced parsley","amount":0.25,"unit":"cups"},{"name":"Freshly ground black pepper"},{"name":"Grated Parmigiano-Reggiano"}],"created":"2017-05-20T13:15:27Z","ratings":[4.0,4.5,4.0,3.5,3.5,3.0,4.0]}
