{"title":"Pesto Pasta With Potatoes and Green Beans","description":"This classic Genovese method of preparing pasta with pesto includes cubes of potato and pieces of green bean, all cooked together in the pasta pot until tender.","preparation_time_minutes":15,"servings":{"min":4,"max":4},"steps":["In a large pot of salted boiling water, boil pasta, potato, and green beans until pasta is al dente and potato and green beans are very tender. Drain, reserving 1 cup cooking water, and transfer pasta, potato, and green beans to a large mixing or serving bowl.","Add pesto sauce to pasta along with 1/4 cup pasta cooking water. Toss well to emulsify pesto and pasta water into a creamy sauce. Add more pasta water, 1 tablespoon at a time, as needed, if pasta is too dry. Drizzle in fresh olive oil, if desired. Serve with Parmigiano Reggiano on the side."],"ingredients":[{"name":"Kosher salt"},{"name":"Dried pasta","amount":450,"unit":"grams"},{"name":"Peeled Yukon Gold potato","amount":140,"unit":"grams"},{"name":"Green beans","amount":110,"unit":"grams"},{"name":"Pesto sauce"},{"name":"Extra-virgin olive oil"},{"name":"Grated Parmigiano Reggiano"}],"created":"2010-12-21T08:52:29Z","ratings":[]}
