{"title":"Lighter Fettuccine Alfredo Recipe","description":"Don't get me wrong — I'm not a health nut or a calorie counter. But let's face it: The feeling you get after downing a bowl of creamy, cheesy fettuccine Alfredo ain't the best. Wouldn't it be great to have a quick and easy version that's just as good as the typical cream-packed rendition, but has a cleaner flavor and doesn't leave you in a food coma?","preparation_time_minutes":30,"servings":{"min":4,"max":4},"steps":["Combine cheese, heavy cream, egg, cornstarch, olive oil, and lemon zest (if using) in a large bowl. Season lightly with salt and heavily with black pepper and whisk to combine. Set aside.","In a large Dutch oven or saucepan, bring 2 quarts of water and 2 tablespoons (24g) of salt to a boil over high heat. Add pasta and cook, stirring frequently to prevent sticking, until cooked but still very firm (not quite al dente), about 45 seconds for fresh pasta or 1 minute less than package directions indicate for dried pasta. Drain pasta into a colander set over a large bowl. Transfer 2 cups (480ml) of cooking water to a liquid measuring cup and discard the rest. Transfer pasta to the now-empty bowl. Add garlic and butter and toss to coat.","Whisking constantly, slowly add 1 1/2 cups of pasta cooking water to bowl with cheese mixture. Transfer cheese mixture to the now-empty pasta cooking pot, scraping the bottom to make sure you get everything. Cook over medium-high heat, stirring constantly with a rubber spatula, until mixture comes to a boil and thickens, about 45 seconds. Season sauce to taste with more salt and pepper as desired. Transfer pasta to sauce mixture and turn to coat. Just before serving, stir in more pasta water to thin sauce out as necessary. Serve immediately, sprinkled with minced herbs, black pepper, and cheese, and drizzled with additional olive oil."],"ingredients":[{"name":"Grated Parmigiano Reggiano cheese","amount":140,"unit":"grams"},{"name":"Heavy cream","amount":30,"unit":"ml"},{"name":"Egg","amount":1,"unit":"pcs"},{"name":"Cornstarch","amount":1,"unit":"tsp"},{"name":"Extra-virgin olive oil","amount":2,"unit":"tbsp"},{"name":"Grated lemon zest","amount":0.5,"unit":"tsp"},{"name":"Kosher salt"},{"name":"Freshly ground black pepper"},{"name":"Fresh fettuccine","amount":450,"unit":"grams"},{"name":"Minced garlic","amount":1,"unit":"tsp"},{"name":"Unsalted butter","amount":30,"unit":"grams"},{"name":"Minced fresh parsley"}],"created":"2008-06-04T14:13:56Z","ratings":[4.0]}
