{"title":"Lighter Tuna Noodle Casserole","description":"Pasta with a light and creamy sauce, tender chunks of tuna, and peas is ready in about 15 minutes start to finish. This is the kind of recipe that I wish I'd known in college. All it takes is a single large skillet or pot, one burner or hot plate, a bowl, and a fork. That's it. And on top of that, it turns out a dish that's not just good-given-the-constraints, but legitimately good-enough-that-I-would've-made-it-for-that-girl-I-was-trying-to-impress-in-college or even good-enough-for-a-mildly-romantic-weeknight-dinner-with-the-wife.","preparation_time_minutes":15,"servings":{"min":4,"max":4},"steps":["Place noodles in a large saucepan or skillet and cover with room temperature tap water by 1 inch. Season lightly with salt. Bring to a boil over high heat and cook, stirring occasionally, until almost done (follow package directions for cook times). Drain all but 1 cup of water. Return to high heat and simmer until water is almost completely reduced.","Meanwhile, combine créme fraiche, egg, cornstarch, and 1 tablespoon lemon juice in a medium bowl and whisk with a fork or whisk until homogenous.","When noodles are cooked, add créme fraiche mixture to skillet and cook, stirring and tossing constantly, until sauce thickens and coats noodles. Season generously with black pepper and salt. Off heat, gently fold in tuna, peas, parsley, and remaining lemon juice until warmed through. Serve immediately drizzled with extra-virgin olive oil and sprinkled with crushed potato chips, if desired."],"ingredients":[{"name":"Dried wide egg noodles","amount":170,"unit":"grams"},{"name":"Kosher salt"},{"name":"Créme fraiche","amount":170,"unit":"grams"},{"name":"Egg","amount":1,"unit":"pcs"},{"name":"Cornstarch","amount":2,"unit":"tsp"},{"name":"Freshly ground black pepper"},{"name":"Lemon juice","amount":2,"unit":"tbsp"},{"name":"Tuna","amount":1,"unit":"cans"},{"name":"Frozen peas","amount":1,"unit":"cups"},{"name":"Picked fresh parsley leaves","amount":0.25,"unit":"cups"},{"name":"Extra-virgin olive oil"},{"name":"Crushed potato chips"}],"created":"2010-08-21T12:51:36Z","ratings":[4.5,3.5]}
