{"title":"One-Skillet Orecchiette With Shrimp, Spinach, and Mushrooms","description":"Earthy, meaty mushrooms, tender shrimp, and silky strands of spinach are the stars of this easy, one-pot pasta dish. A perfect choice for a weeknight dinner, this recipe comes together in less than 30 minutes and makes minimal mess as the action occurs in a single pan.","preparation_time_minutes":25,"servings":{"min":4,"max":4},"steps":["Heat 1 tablespoon olive oil in a pot or 12-inch skillet over medium-high heat until shimmering. Add mushrooms, season with salt, and cook until golden brown, about 3 minutes. Set aside.","In the same pot, add the remaining 1 tablespoon oil and cook until shimmering. Add shallot and a pinch of salt and cook until softened, about 2 minutes. Add garlic and chili flakes and cook until fragrant, about 30 seconds. Then add white wine, scraping up any brown bits in the pan and allow it to reduce slightly, about 1 minute.","Add the pasta and stock, season with salt and bring to a boil. Cook orecchiette, stirring occasionally, until the broth is mostly absorbed and the pasta is al dente, about 10 minutes.","Stir in the spinach and shrimp and cook until the spinach is wilted and the shrimp are pink throughout, about 3 minutes. Stir in the mushrooms and lemon juice, and season with salt and pepper. Serve immediately."],"ingredients":[{"name":"Extra-virgin olive oil","amount":2,"unit":"tbsp"},{"name":"Oyster mushrooms","amount":2,"unit":"cups"},{"name":"Kosher salt"},{"name":"Freshly ground black pepper"},{"name":"Shallot","amount":1,"unit":"pcs"},{"name":"Cloves garlic","amount":2,"unit":"pcs"},{"name":"Dried red chili flakes"},{"name":"Dry white wine","amount":0.25,"unit":"cups"},{"name":"Dried orecchiette","amount":450,"unit":"grams"},{"name":"Homemade chicken stock","amount":950,"unit":"ml"},{"name":"Spinach","amount":2,"unit":"cups"},{"name":"Medium shrimp","amount":450,"unit":"grams"},{"name":"Lemon juice","amount":2,"unit":"tbsp"}],"created":"2005-07-30