{"title":"Skillet Pasta With Mushrooms, Pancetta, and Wilted Greens","description":"This easy one-pot pasta dish is filled with browned bits of pancetta, earthy Shiitake mushrooms and wilted greens, and comes together in just 25 minutes. Finished with nutty shavings of Parmesan and freshly cracked black pepper, it's a perfect weeknight meal.","preparation_time_minutes":30,"servings":{"min":4,"max":4},"steps":["Heat oil in a large saucepan over medium-high heat until shimmering. Add pancetta and cook until fat begins to render and pancetta is lightly browned, about 2 minutes. Stir in mushrooms, tossing until coated with oil. Cook, stirring, until mushrooms have browned and pancetta has rendered most of its fat, about 5 minutes longer. Stir in shallots and serrano and cook until softened, about 1 minute. Remove from heat and scrape pancetta mixture into a bowl. Set aside.","Add stock to now-empty saucepan and bring to a boil over high heat. Add pasta. Cook pasta, stirring occasionally, for 2 minutes less than package instructions, then stir in greens. Cook for 1 minute longer, then stir in pancetta mixture, along with all the rendered fat. Cook until the pasta is al dente, greens are wilted, and liquid has mostly evaporated and formed an emulsified, creamy sauce, about 1 minute (if necessary, add water a tablespoon at a time if liquid completely evaporates before pasta is tender).","Remove from heat and stir in lemon juice and extra-virgin olive oil. Season to taste with salt and pepper. Spoon onto plates and top with Parmesan cheese. Serve immediately."],"ingredients":[{"name":"Extra-virgin olive oil","amount":0.5,"unit":"tbsp"},{"name":"Panchetta","amount":115,"unit":"grams"},{"name":"Shiitake mushrooms","amount":2,"unit":"cups"},{"name":"Shallot","amount":1,"unit":"pcs"},{"name":"Serrano chile pepper","amount":0.5,"unit":"pcs"},{"name":"Homemade chicken or vegetable stock","amount":5,"unit":"cups"},{"name":"Dried fusilli","amount":450,"unit":"grams"},{"name":"Kosher salt"},{"name":"Freshly ground black pepper"},{"name":"Fresh lemon juice","amount":2,"unit":"tbsp"},{"name":"Greens (e.g. kale)","amount":2,"unit":"handful"},{"name":"Parmesan"}],"created":"2014-03-03T17:21:08Z","ratings":[5.0,1.5,3.0,4.5]}
