{"title":"Vegetarian Citrus Pasta With Swiss Chard","description":"Sumac is a Middle Eastern spice that has a tart lemony flavor. You can find it in specialty shops or order it online. I used whole wheat fusilli, which required about a half cup more liquid than regular pasta and adds a denser mouthfeel to the dish. You can use regular as well — just decrease the cooking liquid by 1/2 cup.","preparation_time_minutes":20,"servings":{"min":4,"max":4},"steps":["Heat the oil in a 12-inch skillet over medium-high heat until shimmering. Add the chard stems and season with salt and cook until they begin to soften, about 3 minutes. Add the shallots and cook until they have softened, adding another pinch of salt and the red chile flakes, about 2 minutes.","Add the stock to the pan with the fusilli and adjust the heat to maintain a vigorous boil and cook according to the package directions until the pasta has about 4 minutes left in the cooking process. Then, stir in the chard leaves and cook until the pasta and chard are done. Stir in the lemon juice and zest and adjust the seasoning as needed. Divide among plates, sprinkle with the sumac and freshly grated cheese."],"ingredients":[{"name":"Olive oil","amount":2,"unit":"tbsp"},{"name":"Swiss chard","amount":3,"unit":"handful"},{"name":"Large shallot","amount":1,"unit":"pcs"},{"name":"Kosher salt"},{"name":"Freshly ground black pepper"},{"name":"Dried red chile flakes"},{"name":"Homemade vegetable stock","amount":4.5,"unit":"cups"},{"name":"Whole wheat fusilli pasta","amount":450,"unit":"grams"},{"name":"Fresh lemon juice","amount":2,"unit":"tbsp"},{"name":"Sumac","amount":1,"unit":"tbsp"},{"name":"Parmigiano-Reggiano"}],"created":"2007-10-29T09:12:52Z","ratings":[5.0,5.0,4.5,3.0,2.5,4.0,4.5,3.5,4.0]}
