{"title":"Pasta With Mushrooms, Brussels Sprouts, and Parmesan","description":"A quick dinner of orecchiette pasta tossed in a clingy sauce made with mushrooms, shallots, thyme, and brussels sprouts leaves.","preparation_time_minutes":25,"servings":{"min":4,"max":4},"steps":["Bring a medium pot of salted water to a boil. Heat 1 tablespoon olive oil in a large skillet over high heat until smoking. Add brussels sprouts, toss to coat in oil, season with salt and pepper, cook without moving until well charred on one side. Toss and continue to cook until leaves are bright green and charred in spots, about 2 minutes total. Transfer to a bowl and set aside.","Heat remaining 2 tablespoons oil in the same skillet over high heat until lightly smoking. Add mushrooms and cook, tossing occasionally, until moisture has been evaporated and the mushrooms are well browned, about 4 minutes. Add shallots, garlic, and thyme and cook, stirring, until shallots are softened and fragrant, about 1 minute. Add butter, lemon juice, and stock. Simmer until sauce is reduced and emulsified, about 1 minute. Season to taste with salt and pepper (this may not be necessary if stock is store-bought). Set aside off heat.","Add orecchiette to pot and cook, stirring occasionally, until nearly al dente (about 1 minute less than the package instructions). Drain, reserving 1/2 cup cooking water. Add orecchiette, half of Parmesan, reserved pasta cooking water, and a generous amount of black pepper to mushrooms. Cook, stirring, over high heat until pasta is fully al dente and liquid has thickened into a sauce that coats the pasta, about 1 minute. If sauce looks greasy or broken, add 2 tablespoons of stock or water and stir vigorously to bring it back together. Stir in brussels sprouts leaves and serve, topping with more cheese at the table."],"ingredients":[{"name":"Olive oil","amount":3,"unit":"tbsp"},{"name":"Brussels sprouts","amount":115,"unit":"grams"},{"name":"Kosher salt"},{"name":"Freshly ground black pepper"},{"name":"Mixed mushrooms","amount":225,"unit":"grams"},{"name":"Shallot","amount":1,"unit":"pcs"},{"name":"Cloves garlic","amount":2,"unit":"pcs"},{"name":"Fresh thyme leaves","amount":1,"unit":"tsp"},{"name":"Butter","amount":4,"unit":"tbsp"},{"name":"Freshly squeezed lemon juice","amount":2,"unit":"tsp"},{"name":"Homemade vegetable or chicken stock","amount":0.5,"unit":"cups"},{"name":"Dried orecchiette","amount":450,"unit":"grams"},{"name":"Freshly grated Parmesan cheese","amount":55,"unit":"grams"}],"created":"2015-02-14T11:01:52Z","ratings":[3.5,4.0,3.5,3.0,4.5,4.0]}
