{"title":"Easy Skillet Baked Ziti With Sausage and Ricotta","description":"Nothing says comfort like a baked pasta dish loaded with creamy sauce and cheese. If my full-fledged No-Boil Baked Ziti is the completist, Super Mario 3 version of the dish, this week's skillet ziti is like using the magic whistle to jump straight to World 8. Not quite as satisfying, but a great alternative if time is of the essence.","preparation_time_minutes":30,"servings":{"min":6,"max":8},"steps":["Place pasta in a large bowl and cover with hot water. Season generously with salt. Let rest, stirring twice during the first 10 minutes, while you prepare the other ingredients.","Use a hand blender or countertop blender to process tomatoes until mostly smooth, but still a little chunky. Set aside 3/4 cup of tomatoes. Combine remaining tomatoes, heavy cream, and chicken stock in a medium bowl. Season to taste with salt and set aside.","Heat oil and butter in a large straight-sided sauté pan or Dutch oven over medium-high heat, swirling, until butter is mostly melted. Add sausage and cook, mashing with a potato masher or a whisk, until sausage is no longer pink, about 5 minutes. Add onion and garlic, reduce heat to medium, and cook, stirring frequently, until softened but not browned, about 5 minutes. Add oregano, red pepper flakes, and half of parsley and cook, stirring, until fragrant, about 1 minute.","Add tomato and cream mixture to pan with sausage. Drain noodles in a large colander set in the sink, then add to pan and stir to combine. Stir in half of ricotta, then rapidly stir in half of mozzarella cheese. (Do not over-stir, or the mixture will stretch and stick to your spoon.) Spoon reserved 3/4 cup tomatoes over top of pasta. Dollop with remaining ricotta and scatter remaining mozzarella over top. Sprinkle with half of Parmigiano-Reggiano. Cover and cook over the lowest possible heat for 3 minutes. Remove from heat and let rest, covered, for 5 minutes.","Uncover, sprinkle with remaining Parmigiano-Reggiano and parsley, and serve immediately."],"ingredients":[{"name":"Dry ziti or penne","amount":450,"unit":"grams"},{"name":"Kosher salt"},{"name":"Whole peeled tomatoes","amount":1,"unit":"cans"},{"name":"Heavy cream","amount":1,"unit":"cups"},{"name":"Homemade chicken stock","amount":1,"unit":"cups"},{"name":"Extra-virgin olive oil","amount":2,"unit":"tbsp"},{"name":"Unsalted butter","amount":2,"unit":"tbsp"},{"name":"Italian sausage","amount":450,"unit":"grams"},{"name":"Large onion","amount":1,"unit":"pcs"},{"name":"Cloves garlic","amount":4,"unit":"pcs"},{"name":"Dried oregano","amount":1,"unit":"tbsp"},{"name":"Crushed red pepper flakes","amount":1,"unit":"tsp"},{"name":"Finely minced fresh parsley leaves","amount":0.25,"unit":"cups"},{"name":"Ricotta cheese","amount":350,"unit":"grams"},{"name":"Low-moisture whole-milk mozzarella cheese","amount":450,"unit":"grams"},{"name":"Roughly grated Parmigiano-Reggiano","amount":85,"unit":"grams"}],"created":"2016-01-29T14:21:01Z","ratings":[3.0]}
