{"title":"Crispy Baked Pasta With Mushrooms, Sausage, and Parmesan Cream Sauce","description":"This recipe starts off with crumbled Italian sausage cooked down in a bit of butter. I sauté a few types of mushrooms in the rendered fat, then flavor them with shallots, garlic, and a little bit of soy sauce and lemon juice (this helps bring out their savoriness while also lightening them up). They get finished in a simple creamy sauce flavored with Parmesan cheese. Add some pasta, top it all of with crisp bread crumbs, bake it directly in the cast iron pan you cooked it in, and you've got yourself a one-skillet meal fit for normal everyday folks who perhaps might occasionally feel like kings.","preparation_time_minutes":30,"servings":{"min":4,"max":6},"steps":["Bring a large pot of salted water to a boil and keep at a bare simmer. Combine bread crumbs, 2 ounces cheese, half of parsley, half of chives, 1/4 of shallots, 1/4 of garlic, and olive oil in a medium bowl and massage with hands until combined. Season to taste with salt and pepper.","Melt butter in a large cast iron skillet over medium-high heat until foaming. Add sausage and cook, mashing it with a potato masher or a wooden spoon until broken up and well browned, about 7 minutes. Use a slotted spoon to transfer sausage to a small bowl, leaving fat behind.","Increase heat to high, add mushrooms to skillet, and cook, stirring frequently, until moisture has evaporated and mushrooms are well-browned, about 10 minutes. Add shallots and garlic and cook, stirring, until fragrant, about 30 seconds. Add soy sauce and lemon juice and stir to combine.","Add flour and cook, stirring, until a thin film begins to form on the bottom of the pan, about 1 minute. Slowly whisk in chicken broth followed by heavy cream. Bring to a simmer and cook until thickened, about 2 minutes. Stir in remaining grated cheese until melted. Stir in remaining parsley and chives. Stir in sausage. Season to taste with salt and lots of black pepper.","Adjust rack to 10 inches below broiler element and preheat broiler to high. Cook pasta in salted water according to package directions, removing it when still just shy of al dente. Drain, reserving 1 cup of cooking liquid. Return to pot. Add mushroom mixture and stir to combine, adding liquid to adjust consistency. Pasta should be very loose but not soupy. Return to cast iron skillet and top with bread crumbs. Broil until golden brown, rotating pan as necessary, 2 to 3 minutes. Serve immediately."],"ingredients":[{"name":"Panko-style bread crumbs","amount":1,"unit":"cups"},{"name":"Grated Parmesan cheese","amount":175,"unit":"grams"},{"name":"Chopped fresh parsley leaves","amount":0.25,"unit":"cups"},{"name":"Finely minced fresh chives","amount":2,"unit":"tbsp"},{"name":"Shallots","amount":2,"unit":"pcs"},{"name":"Cloves garlic","amount":2,"unit":"pcs"},{"name":"Extra-virgin olive oil","amount":2,"unit":"tbsp"},{"name":"Kosher salt"},{"name":"Freshly ground black pepper"},{"name":"Unsalted butter","amount":2,"unit":"tbsp"},{"name":"Italian sausage","amount":225,"unit":"grams"},{"name":"Mixed mushrooms","amount":450,"unit":"grams"},{"name":"Soy sauce","amount":1,"unit":"tbsp"},{"name":"Fresh lemon juice","amount":1,"unit":"tbsp"},{"name":"Flour","amount":2.5,"unit":"tbsp"},{"name":"Homemade chicken stock","amount":2,"unit":"cups"},{"name":"Heavy cream","amount":1,"unit":"cups"},{"name":"Fresh ridged pasta","amount":350,"unit":"grams"}],"created":"2002-10-21T15:07:53Z","ratings":[4.0,3.5]}
